(ns advent-2018.day-5
  (:require [clojure.string :as str]))

(def data "")

(defn part-1 [data]
  (let [opposite? (fn [a b]
                    (if (or (nil? a)
                            (nil? b))
                      false
                      (= (Math/abs (- (int a)
                                      (int b)))
                         32)))]
    (->> data
         (reduce (fn [polymer c]
                   (if
                     (opposite? (peek polymer) c)
                     (pop polymer)
                     (conj polymer c)))
                 '())
         count)))

(defn part-2 [data]
  (let [generate-regex (fn [c]
                         (read-string (apply str
                                             "#\"["
                                             (str/lower-case c)
                                             (str/upper-case c)
                                             "]\"")))]
    (->> (range (int \a)
                (int \z))
         (map char)
         (map #(str/replace data (generate-regex %) ""))
         (map part-1)
         (apply min))))

(part-1 data)
(part-2 data)